import React from "react";
const CallButton = () => {
  const makeCall = () => {
    window.location.href = "tel:+6281187094"; // Replace with the actual phone number
  };

  return (
    <button
      onClick={makeCall}
      className="bg-green-500 text-white px-4 py-2 rounded-md hover:bg-green-700"
    >
      Call Now
    </button>
  );
};

export default CallButton;
